import React from 'react'
import InsideModifier from './insideModifier'

export default function ModifierView({title}) {
  const titleList=['Presets','Generator','Volume','Vibrato','Filter','Phaser','Envelope','Filter']
  
  return (
    <div className='ModifierView'>
      <center>
        <table>
          {[0,1,2,3].map(rowIndex => (
            <tr key={rowIndex}>
              {[0,1].map(cellIndex => {
                const titleIndex = rowIndex*2+cellIndex;
                const title = titleList[titleIndex];
                return(
                  <td key = {cellIndex}>
                    <InsideModifier title={title}/>
                  </td>
                );
              })}
            </tr>
          ))}
        </table>
      </center>
    </div>
  )
}
